import React from "react";
import LoginBack from './loginback';
import LoginFront from './loginfront';
import SignupFront from './signupfront';
import SignupBack from './signupback';
import FLIP_CARD from './loginback';
import ReactCardFlip from "react-card-flip";

// import Form from './form';

class LoginScreen extends React.Component {
  constructor() {
    super();
    this.state = {
      isFlipped: false,
    };
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick(e) {
    e.preventDefault();
    this.setState((prevState) => ({ isFlipped: !prevState.isFlipped }));
  }

  render(){
    return (
    <div className="container-fluid login-back">
      <div class="row">
        <div class="col-lg-">
          <LoginBack/>
          {/* <LoginFront/> */}
        </div>
        <div class="col-lg-">
        <ReactCardFlip>
          {this.handleClick}
        <div>
            <SignupFront/>
          </div>
          <div>
          <SignupFront/>
          </div>
          </ReactCardFlip>

          </div>
        </div>
      </div>
  );
}
}
export default LoginScreen;
